import styles from "./Home.module.css";
import React from "react";

function Home ()
{
  return (
    <div>
      <section className={styles["section__container"]}>
        <h1 className={styles["titulo-Home"]}>Game of Trons</h1>
      </section>

      <section className={styles["section__container"]}>
        <h2><span role="img" aria-label="cohete espacial">üåå</span> Journey into the Future</h2>
        <p>In the land of dragons and betrayals, where shadows dance in hearts' travails, rises the Iron Throne, cold and grim, witness to secrets it never will hymn. Among its sharp and icy blades, the plot unfolds, in lost lives cascades, kings and queens crave its mighty sway, yet in its whispers, duty holds sway. In every north wind's soft sigh, tales are told of a war held high, in the game of thrones, one shall prevail,
as shadows dance and realms bewail.</p>
      </section>

      <section className={styles["section__container"]}>
        <h2><span role="img" aria-label="cohete espacial">üåç</span> From Neglect to Innovation</h2>
        <p>Once the cradle of civilization, Earth now stands as a solemn reminder of the consequences of neglect and environmental decline. But fear not, for the ingenuity of mankind has soared to new heights. With our relentless pursuit of advancement, we have not only healed our scars but extended our reach across the cosmos.</p>
      </section>

      <section className={styles["section__container"]}>
        <h2><span role="img" aria-label="cohete espacial">üöÄ</span> Enter Space Travel: Where Dreams Take Flight</h2>
        <p>Embark on an extraordinary journey with our groundbreaking web application, aptly named "Space Travel." As a commander engineer, the fate of humanity's exodus rests in your capable hands. Prepare to face the ultimate challenge: evacuating humankind from their birthplace and guiding them towards a future among the stars.</p>
      </section>

    </div>
  );
}

export default Home;
